  \"Environmental Assessment : Use of Row Crop Farming and Genetically-modified, Glyphosate-tolerant
  Corn and Soybeans on National Wildlife Refuges and Wetlands Management Districts\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 65,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:28.321077\",\n\t\"name\": \"environmental-assessment-use-of-row-crop-farming-and-genetically-modified-glyphosate-toler\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Midwest Region of the U.S. Fish and
  Wildlife Service uses row crop farming on lands within the National Wildlife Refuge
  System to achieve a variety of management objectives. This environmental assessment
  evaluates the effects of the use of geneticallymodified, glyphosate-tolerant (GMGT)
  corn and soybeans and the use of farming as a management tool for multiple objectives
  on National Wildlife Refuge System lands. The evaluation is based on the issues
  and concerns identified during the planning process. Initially four alternatives
  were evaluated: continue farming for multiple objectives with GMGT corn and soybeans
  allowed (no action); farming for habitat restoration objectives only, GMGT corn
  and soybeans allowed; farming for multiple objectives, GMGT corn and soybeans not
  allowed; limited row crop farming, GMGT corn and soybeans not allowed. Upon completion
  of a public review period, comments were evaluated and as a result of this process
  a fifth alternative was developed and selected; continue farming for multiple objectives,
  GMGT corn and soybeans allowed for habitat restoration only. The evaluation of this
  new alternative is also included in the document. The purpose of the proposed action
  is to administer a farming program that contributes to achieving the establishing
  purposes for lands of the National Wildlife Refuge System or the mission of the
  National Wildlife Refuge System\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
